<script>
    $(document).ready(function () {
        $('#example').DataTable();
        $('#toggle-one').bootstrapToggle();
    });
    function changeStatus(Id, elemid) {
        var val = $('#' + elemid).prop(""checked"");
        $.ajax({
            url: '/Certificate/ChangeStatus',
            data: { id: Id, value: val },
            success: function (res) {
                if (res != null) {
                    $('#' + Id).html(res);
                }
                else { alert(""failed""); }
            }
        });
    };
</script>
